window.bookSummaryJSON = "<p><b>Consume—a rare black skill, one decreed by the gods to never be seen again.</b></p> <p>Max is finally getting a handle on the skill, finding enjoyment in battling and striving to grow his skills and stats. His new friends don't know the whole truth, but they flee trouble together, arriving at the human capital of Peltagow. With a new city to explore and dungeons to delve, the party sets their sights on gaining levels and acquiring stronger items.</p> <p>The gods aren't done with Max, continuing to pull strings. Death is just a single misstep away for Max.</p> <p>The adventure of Max, Tanila, Fowl, and Batrire continues!</p>"; 
